CREATE DEFINER=`brett`@`%` PROCEDURE `createValue`(
           parentValueId BIGINT,
           ownerId BIGINT ,
           sessionKey VARCHAR(32),
           type VARCHAR(10),
           objectIndex BIGINT,
           objectKey TEXT,
           isNull TINYINT,
           stringValue TEXT,
           numericValue DOUBLE,
           boolValue TINYINT
)
BEGIN
   
   SET @sessionKey = sessionKey,
           @parentValueId = parentValueId;
           
   SET @sessionId = (
              SELECT Session.sessionId
              FROM   Session
              WHERE Session.sessionKey =
                               @sessionKey
           );
           
   SET @lowerStringValue =
                  LOWER(stringValue);
   
   START TRANSACTION; 
   
   INSERT INTO Value(
           parentValueId,
           ownerId,
           sessionId,
           type,
           objectIndex,
           objectKey,
           lowerObjectKey,
           isNull,
           stringValue,
           numericValue,
           boolValue
   )
   VALUES(
           parentValueId,
           ownerId,
           @sessionId,
           type,
           objectIndex,
           objectKey,
           LOWER(objectKey),
           isNull,
           stringValue,
           numericValue,
           boolValue
   );
   
   SET @valueId = LAST_INSERT_ID();
   
   /* Insert all parents parents */
   
   INSERT
   INTO       ValueParentChild(
                              parentValueId,
                              childValueId
                      )
   SELECT   vpc.parentValueId,
                     @valueId
   FROM     ValueParentChild vpc
   WHERE  vpc.childValueId =
                            @parentValueId;
                    
   IF @parentValueId IS NOT NULL THEN
         INSERT
         INTO       ValueParentChild(
                                    parentValueId,
                                    childValueId
                            )
         SELECT  @parentValueId,
                          @valueId
         WHERE NOT EXISTS(
               SELECT    *
               FROM       ValueParentChild
               WHERE    parentValueId = 
                                      @parentValueId
               AND          childValueId = @valueId
         );
   END IF;
   
   /* Insert this value */
   INSERT
   INTO       ValueParentChild(
                              parentValueId,
                              childValueId
                      )
   VALUES  (
                              @valueId,
                              @valueId
   );
   
   
   COMMIT;
   
   SELECT @valueId AS valueId;
   
   
END ;;
DELIMITER ;
