CREATE DEFINER=`brett`@`%` PROCEDURE `createValueWord`(
      valueId BIGINT,
      lowerWord TEXT
)
BEGIN
  /* This should run in the transaction
  space of the caller */
  
   SET @valueId = valueId,
            @lowerWord = lowerWord,
            @wordId = NULL;
            
   IF NOT EXISTS(
         SELECT *
         FROM   Word
         WHERE Word.word = @lowerWord
   ) THEN
         INSERT
         INTO         Word(word)
         VALUES   (@lowerWord);
         SET @wordId = LAST_INSERT_ID();
   ELSE
         SET @wordId = (
               SELECT Word. wordId
               FROM    Word
               WHERE Word.word = @lowerWord
         );
   END IF;
   
   IF NOT EXISTS(
         SELECT      *
         FROM         ValueWord
         WHERE      ValueWord.valueId = 
                                      @valueId
         AND             ValueWord.wordId =
                                      @wordId
   ) THEN
         INSERT
         INTO      ValueWord(valueId, wordId)
         VALUES (@valueId, @wordId);
   END IF;
END ;;
