CREATE DEFINER=`brett`@`%` PROCEDURE `createValueWords`(
      valueId BIGINT,
      lowerText TEXT
)
BEGIN
  /* This should run in the transaction
  space of the caller */
  
   SET @valueId = valueId,
            @lowerText = lowerText,
            @word = NULL,
            @start = 1,
            @length = LENGTH(@lowerText);
            
   WHILE (@start <= @length) DO
         /* Read first character */
         SET @nchar = SUBSTR(
               @lowerText,
               @start,
               1
         );
         /* Read subsequent delineators */
         WHILE (isDelineator(@nchar) AND
                          @start <= @length) DO
               SET @start = @start + 1;
               SET @nchar = SUBSTR(
                     @lowerText,
                     @start,
                     1
               );
         END WHILE;
         
         
         /* Read word */
         SET @word = '';
         WHILE (isDelineator(@nchar) = 0 AND
                          @start <= @length) DO
              SET @word = CONCAT(@word, @nchar);
              SET @start = @start + 1;
              SET @nchar = SUBSTR(
                     @lowerText,
                     @start,
                     1
               );
        END WHILE;
                          
        IF ( LENGTH(@word) > 0) THEN
              CALL createValueWord(
                    @valueId,
                    @word
              );
        END IF;
              
   END WHILE;
            
END ;;
